import React from 'react';

function Team() {
    return ( 
        <h1>
            <div className='container'>
                <div className='row border-top text-center'>
                    <h4>People</h4>
                    <div className='col-6'>
                      <img src="/media/images/nithin-kamath.jpg" alt="nithin-kamath"
                      style={{borderRadius:"100%",width:"60%"}}></img>
                    </div>
                    <div className='col-7'>

                    </div>
                </div>
            </div>
        </h1>
     );
}

export default Team;
